package com.liveeasy.web.absorption.core.schehule;import java.util.List;/** * 重复策略器 * @param <T> */public interface DuplicateRemover<T> {     /**      * 判断数据是否以存在队列      * @param element      * @return      */     boolean isDuplicate(T element);     /**      * 重置数据去重      */     void resetDuplicateCheck();     /**      * 重入队列      * @param element      */     void redoQueue(T element);     /**      * 元素集重入队列      * @param elements      */     void redoQueueAll(List<T> elements);}